import React from "react";
import "./profile.css"
//import Nav from "./components/Nav"

// User function will receive user properties (username, bio, followers, following, books read)
export default function Profile(props){
  return (
    <>
    {/* <Nav/> */}
      <div className="profileWrapper">

        <div className="profilePic">
          <img
          src="data:image/png;base64,"
          width="130"
          height="130"
          alt=""
          /> 
        </div>

        <div className="profileInfo"> 
          <h1>Sarah Rashid</h1>
          <p>Avid reader of fantasy novels</p>
        </div>

        <div className="followers"> 
          <h1>1000&emsp;600&emsp;12</h1>
          <p>Followers&emsp;Following&emsp;Books read</p>
        </div>

        <DisplayPosts/>
        <DisplayBookshelf/>

      </div>
    </>
  );
}

function DisplayPosts(props){
  return (
    <div className="posts">
      <h2>Posts</h2>
    </div>
  );
}

function DisplayBookshelf(props){
  return (
    <div className="bookshelf">
      <h2>Bookshelf</h2>
    </div>
  );
}
